  false,\n\t\"url\": null,\n\t\"notes\": \"This layer depicts areas designated for
  Chinook Critical Habitat as well as habitat type and quality in the Central Valley
  Spring-run Evolutionary Significant Unit (ESU - a \"distinct population\" of Pacific
  salmon defined as a \"species\" under the Endangered Species Act). These data represent
  the stream segments identified as Critical Habitat by the National Marine Fisheries
  Service (NOAA Fisheries) Southwest Regional Office (SWR). The linework for this
  layer is based on the California Department of Fish and Game (CDFG) and Pacific
  States Marine Fisheries Commission (PSMFC) 1:100,000 scale stream based routed hydrography.
  SWR biologists divided the routed hydrography into stream segments using the best
  available information to represent local Chinook distribution and habitat. As a
  result, each segment has its own unique identifier (GIS_Link) and related presence
  and habitat information. The data set is in shapefile format and can be included
  as a map layer in a GIS. This data set is an updated, final version of 'CVSR_Chinook_Proposed_Critical_Habitat'.
  This GIS layer is part of a larger mapping effort to define the anadromous distribution
  and to designate critical habitat in five steelhead ESU's and two Chinook ESU's
  in California. Several NOAA Fisheries offices participated in this effort. As a
  result, although the same issues were addressed within each ESU, the offices chose
  differing approaches to define and populate the habitat attributes. The consequence
  is that there are some slight differences in the attribute tables between the coastal
  ESUs and the Central Valley ESUs. For a complete description of the NOAA Fisheries
  Critical Habitat Designation project and for links to the final report, frequently
  asked questions, and other project documents, please visit: http://www.nwr.noaa.gov/1salmon/salmesa/crithab/CHsite.htm
  .\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
